import React, { useState } from "react";
import "../Style/addTabStyle.css";
import axios from "axios";
import Header from "../components/Navigation";

const AddSong = () => {
  const [title, setTitle] = useState("");
  const [artist, setArtist] = useState("");
  const [album, setAlbum] = useState("");
  const [chords, setChords] = useState("");
  const [lyrics, setLyrics] = useState("");
  const [isFavorite, setIsFavorite] = useState(false);
  const [albumImage, setAlbumImage] = useState("");
  const [youtubeLink, setYoutubeLink] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();

    // Stvorite objekt s podacima obrasca
    const songData = {
      title: title,
      artist: artist,
      album: album,
      chords: chords,
      lyrics: lyrics,
      favorite: favorite,
      albumPicture: albumPicture,
      ytLink: ytLink,
    };

    // Pošaljite POST zahtjev na backend
    axios
      .post("http://localhost:8000/song/songs", songData)
      .then((response) => {
        // Uspješno spremanje pjesme na backend-u
        console.log(response.data);

        // Resetirajte formu
        setTitle("");
        setArtist("");
        setAlbum("");
        setChords("");
        setLyrics("");
        setIsFavorite(false);
        setAlbumImage("");
        setYoutubeLink("");
      })
      .catch((error) => {
        // Greška pri slanju zahtjeva na backend
        console.error(error);
      });
  };

  return (
    <div>
      <Header />
      <div className="add-song-container">
        <h1>Add Song</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="title">Title:</label>
            <input
              type="text"
              id="title"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="artist">Artist:</label>
            <input
              type="text"
              id="artist"
              value={artist}
              onChange={(e) => setArtist(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="album">Album:</label>
            <input
              type="text"
              id="album"
              value={album}
              onChange={(e) => setAlbum(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="chords">Chords:</label>
            <textarea
              id="chords"
              value={chords}
              onChange={(e) => setChords(e.target.value)}
              required
            ></textarea>
          </div>

          <div className="form-group">
            <label htmlFor="lyrics">Lyrics:</label>
            <textarea
              id="lyrics"
              value={lyrics}
              onChange={(e) => setLyrics(e.target.value)}
              required
            ></textarea>
          </div>

          <div className="form-group">
            <label htmlFor="isFavorite">Is Favorite:</label>
            <select
              id="isFavorite"
              value={isFavorite ? "1" : "0"}
              onChange={(e) => setIsFavorite(e.target.value === "1")}
              required
            >
              <option value="0">No</option>
              <option value="1">Yes</option>
            </select>
          </div>

          <div className="form-group">
            <label htmlFor="albumImage">Album Image Link:</label>
            <input
              type="text"
              id="albumImage"
              value={albumImage}
              onChange={(e) => setAlbumImage(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="youtubeLink">YouTube Link:</label>
            <input
              type="text"
              id="youtubeLink"
              value={youtubeLink}
              onChange={(e) => setYoutubeLink(e.target.value)}
              required
            />
          </div>

          <button type="submit">Add Song</button>
        </form>
      </div>
    </div>
  );
};

export default AddSong;
